Visual word recognition is a complex cognitive function, as written words engage various visual and linguistic processes and, in the case of fluent readers, do so in a remarkably fast and accurate manner. Among many tools that have been developed to study visual word recognition, one of the most influential is masked priming. Initially developed to help disentangle automatic and episodic contributions to priming in lexical decision tasks [@ForsterDavis1984], the masked priming procedure has since proved valuable to uncover the conditions under which orthographic, phonological, morphological, and semantic information impact access to visual word forms, by mitigating strategic effects and minimizing the influence of controlled processes [@Forster1998, for review]. The masked priming procedure generally involves a forward mask (i.e., usually a string of hashes, #####), followed by a prime string presented in lowercase for very short time $SOA < 60$ ms), and a target string presented in uppercase immediately after (*#####* - *prime* - *TARGET*) to which participants are expected to respond. Because the prime presentation is so brief and masked by preceding and subsequent stimuli, most participants report not being aware that a prime string has been presented, and can at most report a screen flicker just before the target presentation [cf. @ForsterEtal2003; @Nievas2010]. 

One of the most robust findings in the masked priming literature is the *repetition priming effect*: when the prime and target are the same string (albeit in a different case, e.g., *word-WORD*), the response to the target is facilitated compared to when the same target is preceded by an unrelated prime (e.g., *phone-WORD*). The fact that the size of masked repetition priming effect is proportional to the duration of the prime [@ForsterEtal2003; @Angele2023] has led some researchers to posit that the masked repetition priming effect reflects a type of "head start" in the processing of the target. In *Interactive-Activation* (IA) models [@McClellandRumelhart1981; @GraingerJacobs1996; @ColtheartEtal2001], this "head start" is conceived of as increased activation of the target entry as a function of its prior activation during the presentation of the prime. These raised activation levels in turn help the entry reach the recognition threshold faster. Alternatively, *search models* like the *entry opening model* [cf. @ForsterEtal2003] posit an *entry opening time* (EOT) that is uniform across lexical items. In this model, the target's EOT is entirely or partially saved due to the fact that the entry opening process is effectively initiated during the presentation of the prime. Finally, *retrospective models* of priming, such as the *memory recruitment model* [@BodnerMasson1997; @MassonBodner2003; @Bodner2014], posit a non-lexical source for the masked repetition priming effect. Under this view, masked repetition priming stems from the exploitation, at post-access stages, of a memory resource created by the encounter with the prime word.

